    visibility: hidden;
    height: 0;
    margin: 0;
    padding: 0;
}
li:nth-child(3) > .s_menu_title {
    visibility: hidden;
    height: 0;
    margin: 0;
    padding: 0;
}
li:nth-child(2) > .s_menu_title {
    visibility: hidden;
    height: 0;
    margin: 0;
    padding: 0;
}
.icon_news {
    visibility: hidden;
    height: 0;
    margin: 0;
    padding: 0;
}


/* panaikinti mokyklos pavadinima ir mokslo metus */
.top_section_back > .col-md-10 {
    visibility: hidden;
    height: 0;
    margin: 0;
    padding: 0;
}

/* panaikinti mobilias paslaugas*/
.icon_mobile {
    visibility: hidden;
    height: 0;
    margin: 0;
    padding: 0;
}

li:nth-child(6) li {
    visibility: hidden;
    height: 0;
    margin: 0;
    padding: 0;
}

/* panaikinti likusi sesijos laika */
#session_section > .col-md-14 {
    visibility: hidden;
    height: 0;
    margin: 0;
    padding: 0;
}

#header_section > div > div {
    border-radius: 20px;
    margin-bottom: 20px;
}

#header_section > div > div > div > div:nth-child(1) > a > div {
    margin-bottom: 20px;
}

#body_section {
    border-radius: 20px;
}

.s_menu_title {
    border-radius: 20px;
}

#s_menu {
    background: none;
    margin: 10px;
    border-right: none;
}

#c_main > div.row > div.col-md-8 {
    margin-right: 20px;
}

#s_menu ol li.is-selected {
    border-radius: 10px;
    color: #fff;
}

#s_menu ol li:hover {
    border-radius: 10px;
    /* Background color when hovered */
}

#footer {
    border-radius: 20px;
}

#footer_section > div > div {
    background: none;
}

.c_tamo_tabs .tab_header li.active {
    border-radius: 10px;
}

#namu_darbai_tabs > ul {
    border-bottom: none;
}

.c_tamo_tabs .tab_header {
    border-bottom: none;
}

#namu_darbai_tabs > ul > li {
    border-radius: 10px;
}

input,
button,
select,
textarea,
.c_btn.utility {
    border-radius: 10px;
}


#header_section > div > div > div > div:nth-child(2) > div:nth-child(1) {
    visibility: hidden;
    height: 0;
    margin: 0;
    padding: 0;
}

#header_section > div > div > div > div:nth-child(2) > div:nth-child(2) > div > div {
    border-left: none !important;
}

#footer_section > div > div {
    border-radius: 20px;
}

a.c_btn, a.remove-item, a.remove-item-inline, .c_btn span, .remove-item span, .remove-item-inline span, .c_btn i, .remove-item i, .remove-item-inline i, .ui-button {
    border-radius: 10px;
}

#c_main > div.row > div.col-md-6.text-center {
    visibility: hidden;
    height: 0;
    margin: 0;
    padding: 0;
    width: 0;
}

#c_main > div.row > div.col-md-8 {
    width: 90%;
    margin-left: 5%;
}
}

